import Navbar from './components/Navbar.js';
import './styles.css';
import {Routes} from "react-router-dom";
import Inicio from "./routes/Inicio";
import Nosotros from "./routes/Nosotros";

function App() {
  return (
    <div className="App">
        <Navbar/>
        <Inicio/>
        <Nosotros/>
    </div>
  );
}

export default App;
